import './HomePage.scss';

function HomePage() {
    return (
        <article>
            <h1>Hi, I'm Laurie.</h1>
            <p>I am a full-stack web developer, currently based in Kamloops, BC. My toolbox includes React, JavaScript, HTML, CSS, Sass, Node, Express & MySQL. I am passionate about action sports and the outdoors.</p>
            <button>Learn More</button>
            <button>See Projects</button>
        </article>
    );
}

export default HomePage;
